import React from "react"

class Recipe extends React.Component {
    render() {
        return (
            <div className="container">
            <div className="row">
                {
                    this.props.data.map((recipe) => {
                        return (
                            <div key ={recipe.recipe_id} className="col-md-4">
                            <div className="card" style = {{marginBottom:"2rem"}}>
                                <img src={recipe.image_url} alt={recipe.title} className = "card-img-top" style = {{height:"100px"}}></img>
                                <h5 className="card-title">{recipe.title}</h5>
                                <p className="card-text">Publisher: {recipe.publisher}</p>
                                <button className="btn btn-info">View Recipe</button>
                            </div>
                            </div>
                        )
                    })
                }
            </div>
            </div>
        )
    }
}

export default Recipe
